import React from "react";
import {BrowserRouter as Routers, Router, Route, Routes } from "react-router-dom"
import Home from "./components/Home";
import About from "./components/About"; 
import Skills from "./components/Skills";
import Contact from "./components/Contact";
import Signup from "./components/Signup.js";
import "./App.css";
import "./components/Navbar";
import Navbar from "./components/Navbar";


const App = () => {
  return (
    <Router>
      <Navbar />

     <Switch>
        <Route path="/welcome" components={Home} exact/>


          <Route path="/about" components={About} exact/>


          <Route path="/skills" components={Skills} exact/>


          <Route path="/contact" components={Contact} exact/>


          <Route path="/signup" components={Signup} exact/>

     </Switch>


    </Router>
  );
}

export default App;
